/* Задание №1.
	Повторить все действия по доработке  БД vk */
-- Шёл вместе с Вами по уроку, с этого момента начали изменять таблицы


ALTER TABLE friend_requests
ADD CONSTRAINT sender_not_reciever_check
CHECK (from_user_id != to_user_id);

SHOW CREATE TABLE users;

ALTER TABLE users MODIFY COLUMN phone CHAR(11) NOT NULL;

ALTER TABLE users
ADD CONSTRAINT phone_check
CHECK (LENGTH(phone) = 11 AND phone NOT LIKE '%[^0-9]%');

SHOW CREATE TABLE messages;

ALTER TABLE messages MODIFY COLUMN updated_at DATETIME DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP;

SHOW CREATE TABLE profiles;

ALTER TABLE profiles MODIFY COLUMN photo_id BIGINT UNSIGNED DEFAULT NULL UNIQUE;

SHOW CREATE TABLE media_types;

ALTER TABLE media_types MODIFY COLUMN name VARCHAR(45) NOT NULL UNIQUE;


