/*Задание №3.
	Написать запрос для переименования названий типов медиа (колонка name в media_types) в осмысленные для полученного дампа с данными (например, в "фото", "видео", ...). */

-- Изменим папки, используя изученную операцию UPDATE
-- По функционалу операция позволяет обновлять столбцы в соответствии с новыми значениями в строках существующей таблицы
-- Для изменения необзодимо задавать величины (имена) в SET и номера строк(id) в WHERE

UPDATE media_types
    SET name = 'photo'
WHERE id = 1;

UPDATE media_types
    SET name = 'video'
WHERE id = 2;

UPDATE media_types
    SET name = 'music'
WHERE id = 3;

UPDATE media_types
    SET name = 'gifs'
WHERE id = 4;

